import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, Button } from 'react-bootstrap';

const Dashboard = () => {
  const handleNewListing = () => {
    console.log("New Listing clicked");
  };

  const handleMyListings = () => {
    console.log("My Listings clicked");
  };

  const handleLogout = () => {
    console.log("Logout clicked");
  };

  const cardData = [
    {
      id: 1,
      image: 'path/to/image1.jpg', // Replace with actual image paths
      title: 'Listing Title 1',
      description: 'Description for Listing 1.',
      existingBids: ['Bid 1', 'Bid 2', 'Bid 3']
    },
    {
      id: 2,
      image: 'path/to/image2.jpg',
      title: 'Listing Title 2',
      description: 'Description for Listing 2.',
      existingBids: ['Bid 1', 'Bid 2']
    },
    {
      id: 3,
      image: 'path/to/image3.jpg',
      title: 'Listing Title 3',
      description: 'Description for Listing 3.',
      existingBids: ['Bid 1', 'Bid 2', 'Bid 3', 'Bid 4']
    },
    {
      id: 1,
      image: 'path/to/image1.jpg', // Replace with actual image paths
      title: 'Listing Title 1',
      description: 'Description for Listing 1.',
      existingBids: ['Bid 1', 'Bid 2', 'Bid 3']
    },
    {
      id: 2,
      image: 'path/to/image2.jpg',
      title: 'Listing Title 2',
      description: 'Description for Listing 2.',
      existingBids: ['Bid 1', 'Bid 2']
    },
    {
      id: 3,
      image: 'path/to/image3.jpg',
      title: 'Listing Title 3',
      description: 'Description for Listing 3.',
      existingBids: ['Bid 1', 'Bid 2', 'Bid 3', 'Bid 4']
    },
  ];

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg sticky-top" style={{ backgroundColor: 'lightblue' }}>
        <div className="container">
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav me-auto">
              <li className="nav-item">
                <button className="btn btn-link nav-link" onClick={handleNewListing} style={{ fontWeight: 'bold', fontSize: '20px' }}>
                  New Listing
                </button>
              </li>
              <li className="nav-item">
                <button className="btn btn-link nav-link" onClick={handleMyListings} style={{ fontWeight: 'bold', fontSize: '20px' }}>
                  My Listings
                </button>
              </li>
            </ul>
            <div className="d-flex">
              <button className="btn btn-danger" onClick={handleLogout}>
                Logout
              </button>
            </div>
          </div>
        </div>
      </nav>

      {/* Main content */}
      <div className="container mt-4">
        <div className="row">
          {cardData.map((card) => (
            <div className="col-md-4 mb-4" key={card.id}>
              <Card>
                <Card.Img variant="top" src={card.image} />
                <Card.Body>
                  <Card.Title>{card.title}</Card.Title>
                  <Card.Text>{card.description}</Card.Text>
                  <Card.Subtitle className="mb-2 text-muted">Existing Bids:</Card.Subtitle>
                  <ul>
                    {card.existingBids.map((bid, index) => (
                      <li key={index}>{bid}</li>
                    ))}
                  </ul>
                  <Button variant="primary">Make a Bid</Button>
                </Card.Body>
              </Card>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
